import NavigationBar from "../NavigationBar/NavigationBar";
import Avatar from "../Avatar/Avatar";
import "./App.css";
import avatar from "../../Images/girl-coder.png";
function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Avatar />
      <img src={avatar} alt="Avatar" />
    </div>
  );
}

export default App;
